    VOS_UINT32                                              aulMqAcmac[2];       /**< aulMqAcmac[0] 31..0, aulMqAcmac[1] 41..32 */
    VOS_UINT32                                              ulACstartTime[2];    /**< Probe start time in units of slots [0] low, [1] high */
    VOS_UINT16                                              usPreambleLength;    /**< Preamble length (default: frames [1..7], enhanced: slots [4 or 16], [1..7]*16 */
    VOS_UINT16                                              usNbrOfMACPackets;   /**< Length of transmission in frames <= CapsuleLengthMax */
    VOS_INT16                                               sDataOffsetNorm;     /**< unit 0.5dB, signed magnitude format */
    VOS_INT16                                               sDataOffset9k6;      /**< unit 0.25dB, signed magnitude format */
    VOS_INT16                                               sDataOffset19k2;     /**< unit 0.25dB, signed magnitude format */
    VOS_INT16                                               sDataOffset38k4;     /**< unit 0.25dB, signed magnitude format */
    VOS_UINT16                                              usOpenLoopAdjust;    /**< units of 1 dB, The value used by the access terminal is -1 times the value */
    VOS_UINT16                                              usPowerStep;         /**< units of 0.5 dB, it used in (i-1)*powerStep */
    VOS_UINT16                                              usProbeIndex;        /**< the i-th probe in a probe sequence, [1..15], it correspond to i */
    VOS_INT16                                               sProbeInitialAdjust; /**< unit 1dB, signed magnitude format, only for default access */
